Platoon is a 1986 war film written and directed by Oliver Stone and starring Tom Berenger, Willem Dafoe, and Charlie Sheen. It is the first of Stone\'s Vietnam War trilogy, followed by 1989\'s Born on the Fourth of July and 1993\'s Heaven &amp; Earth.
